import React from 'react';
import { Menu, Article } from 'grommet-icons';
import {
  Anchor,
  Box,
  Grommet,
  Header,
  Nav,
 
  ResponsiveContext,
  DropButton,
} from 'grommet';
import { grommet } from 'grommet/themes';

const CollapsableNav = () => (
  <Grommet theme={grommet}>
    <Header background="dark-1" pad="medium">
      <Box direction="row" align="center" gap="small">
        <Article />
      </Box>
      <ResponsiveContext.Consumer>
        {(responsive) =>
          responsive === "small" ? (
            // <Menu icon={<Men />}
            //   items={[
            //     { label: 'Home', onClick: () => {} },
            //     { label: 'Login', onClick: () => {} },
            //     { label: 'Signup', onClick: () => {} },
            //   ]}

            // />
            <DropButton
              
              dropAlign={{ top: "bottom", right: "right" }}
              dropContent={<Box pad="large" background="light-2" />}
            />
          ) : (
            <Nav direction="row">
              <Anchor href="/" label="Home" />
              <Anchor href="/Login" label="Login" />
              <Anchor href="/Signup" label="Signup" />
            </Nav>
          )
        }
      </ResponsiveContext.Consumer>
    </Header>
  </Grommet>
);

export const Collapsable = () => <CollapsableNav />;
